import logo from './logo.svg';
import './App.css';
import {BrowserRouter,Routes,Route} from 'react-router-dom';
import Login from './Components/Login';
import Register from './Components/Register';
import Dashboard from './Components/Dashboard';
import CreateProducts from './Components/CreateProducts';
import ViewProduct from './Components/ViewProduct';
import UpdateProduct from './Components/UpdateProduct';
import Update from './Components/Update';
import UserDashboard from './Components/UserDashboard';
import AddProduct from './Components/AddProduct';
import ViewSubProducts from './Components/ViewSubProducts';
import CreateCategory from './Components/CreateCategory';
import ViewCategory from './Components/ViewCategory';
import AddSubProduct from './Components/AddSubProduct ';
import ViewMainProducts from './Components/ViewMainProducts';
function App() {
  return (
    <div className="App">
      <BrowserRouter>
      <Routes>
        <Route path="/userregister" element={<Register/>} />
        <Route path="/" element={<Login/>} />
        <Route path='/update/:id' element={<Update/>} />
        <Route path='/viewcategory' element={<ViewCategory/>}/>
        <Route path='/userdashboard' element={<UserDashboard/>}/>
        <Route path='/view' element={<ViewProduct/>}/>
        <Route path='/addproduct/:cid' element={<AddProduct/>}/>
        <Route path='/addsubproduct/:cid' element={<AddSubProduct/>}/>
        <Route path='/viewmainproduct' element={<ViewMainProducts/>}/>
        <Route path="/dashboard" element={<Dashboard/>} >
          <Route path="/dashboard/addproducts" element={<CreateCategory/>} />
          <Route path="/dashboard/viewproducts" element={<ViewSubProducts/>} />
          <Route path="/dashboard/update" element={<UpdateProduct/>} />



        </Route>

      </Routes>
      </BrowserRouter>


    </div>
  );
}

export default App;
